import axios from "axios";

const BASE_URL = "http://localhost:3000/api/"

const TOKEN = "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjYyNjk3MWI0ODdlNDM3YmI3MmVjZjk0ZSIsImlzQWRtaW4iOnRydWUsImlhdCI6MTY1MTExODAyOSwiZXhwIjoxNjUxMzc3MjI5fQ.mtokTyV2kMib4ekA1iXEa4MXspU4Lo5f8pgM6vPDoKo"

export const publicRequest = axios.create({
    baseURL : BASE_URL,
})
export const userRequest = axios.create({
    baseURL : BASE_URL,
    header:{token: `Bearer ${TOKEN}`}
})
